{  const typeName = `${context.fileName}`;  return `/* GENERATED BY TYPECHAIN VER. ${getVersion()} */ /* tslint:disable */  import { BigNumber } from 'bignumber.js'; import { TypeChainContract, promisify, ITxParams, IPayableTxParams, DeferredTransactionWrapper } from '${  context.relativeRuntimePath  }'  export class ${typeName} extends TypeChainContract {  public readonly rawWeb3Contract: any;  public constructor(web3: any, address: string | BigNumber) {  const abi = ${JSON.stringify(abi)};  super(web3, address, abi);  }   static async createAndValidate(web3: any, address: string | BigNumber): Promise<${typeName}> {  const contract = new ${typeName}(web3, address);  const code = await promisify(web3.eth.getCode, [address]);  if (code === '0x0') {  throw new Error(\`Contract at \${address} doesn't exist!\`);  }  return contract; }  ${input.constants  .map(  constant =>  `public get ${  constant.name  }(): Promise<${constant.output.generateCodeForOutput()}> { return promisify(this.rawWeb3Contract.${  constant.name  }, []); }`,  )  .join('
')} ${input.constantFunctions  .map(  constantFunction =>  `public ${constantFunction.name}(${constantFunction.inputs  .map(codeGenForParams)  .join(', ')}): Promise<${codeGenForOutputTypeList(  constantFunction.outputs,  )}> { return promisify(this.rawWeb3Contract.${  constantFunction.name  }, [${constantFunction.inputs.map(codeGenForArgs).join(', ')}]); }`,  )  .join(';
')} ${input.functions  .map(func => {  const txParamsType = func.payable ? 'IPayableTxParams' : 'ITxParams';  return `public ${func.name}Tx(${func.inputs  .map(codeGenForParams)  .join(  ', ',  )}): DeferredTransactionWrapper<${txParamsType}> { return new DeferredTransactionWrapper<${txParamsType}>(this, '${  func.name  }', [${func.inputs.map(codeGenForArgs).join(', ')}]);  }`;  })  .join(';
')} }`; }

{  const errors = type.validate(value, [{ path: '', type }])   if (errors.length > 0) {  console.error('Failed to create `${type.name}` from:', value)  fail(  `Error while converting ${shortenPrintValue(  prettyPrintValue(value)  )} to \`${type.name}\`:

 ` + errors.map(toErrorString).join('
 ')  )  } }
